BEGIN TRANSACTION;
CREATE TABLE time_dimension(id INTEGER PRIMARY KEY AUTOINCREMENT, year INTEGER UNIQUE);
CREATE TABLE grade_dimension(id INTEGER PRIMARY KEY AUTOINCREMENT, sequence INTEGER, name VARCHAR(80));
CREATE TABLE enrollment_facts(id INTEGER PRIMARY KEY AUTOINCREMENT, time_id INTEGER, district_id INTEGER, grade_id INTEGER, size INTEGER);
CREATE TABLE district_dimension(id INTEGER PRIMARY KEY AUTOINCREMENT, code CHAR(4) UNIQUE, name VARCHAR(80), county VARCHAR(80));
COMMIT;
